import React, { useState } from 'react';

const categories = [
  { key:'working', label:'Working Days' },
  { key:'saturday', label:'Saturday / MF Holidays' },
  { key:'sunday', label:'Sunday' }
];
const directions = ['Nila → Sahyadri','Sahyadri → Nila'];

function ensureStructure(multi){
  if(!multi) multi={};
  categories.forEach(c=>{
    if(!multi[c.key]) multi[c.key]={ routes:{ 'Nila → Sahyadri':[], 'Sahyadri → Nila':[] } };
    directions.forEach(r=>{ if(!Array.isArray(multi[c.key].routes[r])) multi[c.key].routes[r]=[]; });
  });
  return JSON.parse(JSON.stringify(multi));
}

const BusEditorModal = ({ value, specials, onSave, onClose }) => {
  const [multi,setMulti] = useState(()=>ensureStructure(value));
  const [spec,setSpec] = useState(()=>({
    palakkadTown: specials?.palakkadTown?.join('\n') || '',
    wisePark: specials?.wisePark?.join('\n') || ''
  }));

  function updateTimes(cat, dir, text){
    const list = text.split(/[,\n]+/).map(t=>t.trim()).filter(Boolean);
    setMulti(m=>{ const n=ensureStructure(m); n[cat].routes[dir]=list; return n; });
  }
  function handleSave(){
    onSave({ multi, specials:{
      palakkadTown: spec.palakkadTown.split(/\n+/).map(s=>s.trim()).filter(Boolean),
      wisePark: spec.wisePark.split(/\n+/).map(s=>s.trim()).filter(Boolean)
    }});
  }

  return (
    <div className="modal-backdrop" role="dialog" aria-modal="true">
      <div className="modal large">
        <div className="modal-header">
          <h3>Edit Bus Timings</h3>
          <button className="icon-btn" onClick={onClose}>✕</button>
        </div>
        <div style={{display:'flex', flexWrap:'wrap', gap:'1.25rem'}}>
          {categories.map(cat => (
            <div key={cat.key} style={{flex:'1 1 340px', minWidth:320}}>
              <h4 style={{margin:'4px 0'}}>{cat.label}</h4>
              {directions.map(dir => (
                <div key={dir} className="field-row">
                  <label style={{fontSize:'0.8rem'}}>{dir}</label>
                  <textarea
                    rows={3}
                    placeholder="Times comma or newline separated (HH:MM or 12h)"
                    value={multi[cat.key].routes[dir].join(', ')}
                    onChange={e=>updateTimes(cat.key, dir, e.target.value)}
                  />
                </div>
              ))}
            </div>
          ))}
          <div style={{flex:'1 1 340px', minWidth:320}}>
            <h4>Special Routes</h4>
            <div className="field-row">
              <label>Palakkad Town (one per line)</label>
              <textarea rows={6} value={spec.palakkadTown} onChange={e=>setSpec(s=>({...s,palakkadTown:e.target.value}))} />
            </div>
            <div className="field-row">
              <label>Wise Park Junction (one per line)</label>
              <textarea rows={6} value={spec.wisePark} onChange={e=>setSpec(s=>({...s,wisePark:e.target.value}))} />
            </div>
          </div>
        </div>
        <div className="modal-footer">
          <button className="secondary-btn" onClick={onClose}>Cancel</button>
          <button className="primary-btn" onClick={handleSave}>Save</button>
        </div>
      </div>
    </div>
  );
};

export default BusEditorModal;
